import React from 'react';
import './index.css';
import {BrowserRouter as Router,Route, Link} from 'react-router-dom'; 
import {Container, Navbar} from 'react-bootstrap';
import Footer from './components/Footer';
import Nav from 'react-bootstrap/Nav';

import HomePage from './pages/HomePage';
import AboutPage from './pages/AboutPage';
import ContactPage from './pages/ContactPage';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';



class App extends React.Component {
  constructor(props){
    super(props);
    this.state ={
      title:"Thandi Inoccentia",
      headerLinks:[
        {title:'Name', path: '/'},
        {title:'About', path: '/about'},
        {title:'Contact', path: '/contact'}
      ],
      home:{
        title:'Thandi Inoccentia,',
        subtitle:'Welcome',
      },
      contact:{
        title:'Contact me'
      },
      about:{
        title:'About Me'
      }
    }
  }

  render(){
    return (
      <Router>
        <Navbar className="border"  expand="lg" color="white">
        <Navbar.Toggle className="border-0" aria-controls="navbar-toggle"/>
        <Navbar.Collapse id="navbar-toogle">
        <Nav className="ml-auto">
          <Link className="nav-link" to="/">Home</Link>
          <Link className="nav-link" to="/about">About</Link>
          <Link className="nav-link" to="/contact">Contact</Link>

        </Nav>
      </Navbar.Collapse>
      </Navbar>
      
      <HomePage />
      <AboutPage/>
      <ContactPage />
     
      <footer className="mt-5">
        <Container fluid={true}>
              <Row className="border-top justify-content-between p-3">
                  <Col className="p-0" md={3} sm={12}>
                      Email : <a useRef="thandiinnocentia355@gmail.com">thandiinnocentia355@gmail.com</a>
                  </Col>
                  <Col className="p-0" md={3} >
                      Address : <p>03 Outeniqua Sonlandpark vereening 1929</p>
                  </Col>
                  <Col className="p-0 d-flex justify-content-end" md={3}>
                      This site was created by ntombi
                  </Col>
              </Row>
          </Container>
      </footer>
    </Router>  
    );
  }
  
}

export default App;
